import React from 'react'
import { Image,StyleSheet, Text, View } from 'react-native';

const  ImageRestau = (props) => {
  const image = props.restau.image;
  return (
    <View style={styles.combine_components}>
      <Text>{props.restau.name}</Text>
      <Image source={require('image!' + props.restau.image)}
//            <Image source={require(props.image)}

        style={styles.photo}/>
    </View>
  )
}

export default ImageRestau

const styles = StyleSheet.create({
  combine_components:{
    marginTop:'40%',
    width: '100%',
    height: '50%',
    color:'blue',
    display: 'flex',
    flexDirection:'row'
  },
  photo:{
    width: '40%',
    height: '100%',
    borderColor:'50%'
  },
  btn:{
    width: '60%',
    height: '100%',
    borderColor:'50%'
  },
})
